import React from 'react'

const project_content = () => {

  return (
    <div className="form-container">
      {/* <h2>{id ? 'Update About Page' : 'Create About Page'}</h2> */}
      <h2>Create About Page</h2>
      <form onSubmit={handleBlogPostSave}>

        <div className="form-group">
          <label>History Content</label>
          <textarea
            name="history_content"
            value={formData.history_content}
            onChange={handleInputChange}
            rows="10"
            required
          ></textarea>
        </div>

        <div className="form-group">
          <label>Created At</label>
          <input
            type="datetime-local"
            name="created_date"
            value={formData.created_date}
            onChange={handleInputChange}
            required
          />
        </div>

        {/* <button type="submit">{id ? 'Update About' : 'Create About'}</button> */}
        <button type="submit">Create About</button>
      </form>
    </div>
  );
}

export default project_content
